import logo from './logo.svg';
import './App.css';

import React, { useState } from 'react';

function App() {
  const [colorNumbers, setColorNumbers] = useState(dataColorNumbers);

  const randNumbers = () => {
    alert('RANDOM COLORS');
    let new_random = colorNumbers.sort( () => .5 - Math.random() );
    setColorNumbers(new_random);
  }

  return (
    <div className="App">
      <div className="container">
        <div className="masonry-columns">
          { colorNumbers.map((b) => {
            return (
              <div key={b.number} className= 'box' style={{background: b.color}} onClick={(e) => randNumbers()}>
                {b.number}
              </div>
            )
          })}
        </div>
      </div>
    </div>
  );
}

export default App;
